prompt --application/deployment/install/install_ascvd_risk_calculator
begin
wwv_flow_imp_shared.create_install_script(
 p_id=>wwv_flow_imp.id(26377462907443208)
,p_install_id=>wwv_flow_imp.id(26375590565399832)
,p_name=>'ASCVD_RISK_CALCULATOR'
,p_sequence=>30
,p_script_type=>'INSTALL'
,p_script_clob=>wwv_flow_string.join(wwv_flow_t_varchar2(
'create or replace package ascvd_risk_calculator as',
'',
'  FUNCTION computeTenYearScore(age IN NUMBER, ',
'                               totalCholesterol IN NUMBER, ',
'                                hdl IN NUMBER, ',
'                                systolicBloodPressure IN NUMBER, ',
'                                hypertensive IN NUMBER,',
'                                smoker IN NUMBER,',
'                                diabetic IN NUMBER,',
'                                race IN VARCHAR2,',
'                                gender IN VARCHAR2)',
'    RETURN NUMBER;',
'',
'  FUNCTION computeLifetimeRisk(age IN NUMBER, ',
'                               totalCholesterol IN NUMBER, ',
'                               hdl IN NUMBER, ',
'                               systolicBloodPressure IN NUMBER, ',
'                               hypertensive IN NUMBER,',
'                               smoker IN NUMBER,',
'                               diabetic IN NUMBER,',
'                               race IN VARCHAR2,',
'                               gender IN VARCHAR2) ',
'  RETURN NUMBER;',
'  FUNCTION computeLowestTenYear(age IN NUMBER,',
'                               race IN VARCHAR2,',
'                               gender IN VARCHAR2) ',
'  RETURN NUMBER;',
'  FUNCTION computeLowestLifetime(age IN NUMBER,',
'                               race IN VARCHAR2,',
'                               gender IN VARCHAR2) ',
'  RETURN NUMBER;',
'  FUNCTION computePotentialRisk(reductions IN VARCHAR2, ',
'                                score IN VARCHAR2,',
'                                age IN NUMBER, ',
'                                totalCholesterol IN NUMBER, ',
'                                hdl IN NUMBER, ',
'                                systolicBloodPressure IN NUMBER, ',
'                                hypertensive IN NUMBER,',
'                                smoker IN NUMBER,',
'                                diabetic IN NUMBER,',
'                                race IN VARCHAR2,',
'                                gender IN VARCHAR2)',
'  RETURN NUMBER;',
'  FUNCTION lowestPossibleRisk(age IN NUMBER,',
'                               race IN VARCHAR2,',
'                               gender IN VARCHAR2) ',
'  RETURN NUMBER;',
'end ascvd_risk_calculator;',
'/',
'create or replace package body ASCVD_RISK_CALCULATOR as',
'',
'  FUNCTION computeTenYearScore(age IN NUMBER, ',
'                                totalCholesterol IN NUMBER, ',
'                                hdl IN NUMBER, ',
'                                systolicBloodPressure IN NUMBER, ',
'                                hypertensive IN NUMBER,',
'                                smoker IN NUMBER,',
'                                diabetic IN NUMBER,',
'                                race IN VARCHAR2,',
'                                gender IN VARCHAR2)',
'    RETURN NUMBER',
'  IS',
'    lnAge NUMBER := LN(age);',
'    lnTotalChol NUMBER := LN(totalCholesterol);',
'    lnHdl NUMBER := LN(hdl);',
'    trlnsbp NUMBER := CASE WHEN hypertensive = 1 THEN LN(systolicBloodPressure) ELSE 0 END;',
'    ntlnsbp NUMBER := CASE WHEN hypertensive = 0 THEN LN(systolicBloodPressure) ELSE 0 END;',
'    ageTotalChol NUMBER := lnAge * lnTotalChol;',
'    ageHdl NUMBER := lnAge * lnHdl;',
'    agetSbp NUMBER := lnAge * trlnsbp;',
'    agentSbp NUMBER := lnAge * ntlnsbp;',
'    ageSmoke NUMBER := CASE WHEN smoker = 1 THEN lnAge ELSE 0 END;',
'    isAA BOOLEAN := (race = ''aa'');',
'    isMale BOOLEAN := (gender = ''male'');',
'    s010Ret NUMBER := 0;',
'    mnxbRet NUMBER := 0;',
'    predictRet NUMBER := 0;',
'    ',
'    FUNCTION calculateScore RETURN NUMBER',
'    IS',
'    BEGIN',
'      IF isAA AND NOT isMale THEN',
'        s010Ret := 0.95334;',
'        mnxbRet := 86.6081;',
'        predictRet :=',
'          17.1141 * lnAge +',
'          0.9396 * lnTotalChol +',
'          -18.9196 * lnHdl +',
'          4.4748 * ageHdl +',
'          29.2907 * trlnsbp +',
'          -6.4321 * agetSbp +',
'          27.8197 * ntlnsbp +',
'          -6.0873 * agentSbp +',
'          0.6908 * CASE WHEN smoker = 1 THEN 1 ELSE 0 END +',
'          0.8738 * CASE WHEN diabetic = 1 THEN 1 ELSE 0 END;',
'      ELSIF NOT isAA AND NOT isMale THEN',
'        s010Ret := 0.96652;',
'        mnxbRet := -29.1817;',
'        predictRet :=',
'          -29.799 * lnAge +',
'          4.884 * POWER(lnAge, 2) +',
'          13.54 * lnTotalChol +',
'          -3.114 * ageTotalChol +',
'          -13.578 * lnHdl +',
'          3.149 * ageHdl +',
'          2.019 * trlnsbp +',
'          1.957 * ntlnsbp +',
'          7.574 * CASE WHEN smoker = 1 THEN 1 ELSE 0 END +',
'          -1.665 * ageSmoke +',
'          0.661 * CASE WHEN diabetic = 1 THEN 1 ELSE 0 END;',
'      ELSIF isAA AND isMale THEN',
'        s010Ret := 0.89536;',
'        mnxbRet := 19.5425;',
'        predictRet :=',
'          2.469 * lnAge +',
'          0.302 * lnTotalChol +',
'          -0.307 * lnHdl +',
'          1.916 * trlnsbp +',
'          1.809 * ntlnsbp +',
'          0.549 * CASE WHEN smoker = 1 THEN 1 ELSE 0 END +',
'          0.645 * CASE WHEN diabetic = 1 THEN 1 ELSE 0 END;',
'      ELSE',
'        s010Ret := 0.91436;',
'        mnxbRet := 61.1816;',
'        predictRet :=',
'          12.344 * lnAge +',
'          11.853 * lnTotalChol +',
'          -2.664 * ageTotalChol +',
'          -7.99 * lnHdl +',
'          1.769 * ageHdl +',
'          1.797 * trlnsbp +',
'          1.764 * ntlnsbp +',
'          7.837 * CASE WHEN smoker = 1 THEN 1 ELSE 0 END +',
'          -1.795 * ageSmoke +',
'          0.658 * CASE WHEN diabetic = 1 THEN 1 ELSE 0 END;',
'      END IF;',
'',
'      RETURN ROUND((1 - POWER(s010Ret, EXP(predictRet - mnxbRet))) * 100 * 10) / 10;',
'    END;',
'    ',
'  BEGIN',
'    IF age < 40 OR age > 79 THEN',
'      RETURN NULL;',
'    ELSE',
'      RETURN calculateScore();',
'    END IF;',
'  END;',
'  ---',
'  FUNCTION computeLifetimeRisk(age IN NUMBER, ',
'                               totalCholesterol IN NUMBER, ',
'                               hdl IN NUMBER, ',
'                               systolicBloodPressure IN NUMBER, ',
'                               hypertensive IN NUMBER,',
'                               smoker IN NUMBER,',
'                               diabetic IN NUMBER,',
'                               race IN VARCHAR2,',
'                               gender IN VARCHAR2) ',
'  RETURN NUMBER IS',
'    ascvdRisk NUMBER := 0;',
'',
'    -- Define the parameters',
'    major number;',
'    major2 NUMBER := 0;',
'    major1 NUMBER := 0;',
'    elevated_score NUMBER := 0;',
'    not_optimal NUMBER := 0;',
'    all_optimal NUMBER := 0;',
'    notOptimal number;',
'    allOptimal number;',
'    elevated number;',
'  BEGIN',
'    IF age < 20 OR age > 59 THEN',
'      RETURN NULL;',
'    END IF;',
'',
'    -- Define the parameters based on gender',
'    IF gender = ''male'' THEN',
'      major2 := 69;',
'      major1 := 50;',
'      elevated := 46;',
'      notOptimal := 36;',
'      allOptimal := 5;',
'    ELSIF gender = ''female'' THEN',
'      major2 := 50;',
'      major1 := 39;',
'      elevated := 39;',
'      notOptimal := 27;',
'      allOptimal := 8;',
'    END IF;',
'',
'    -- Calculate the values',
'    BEGIN',
'      major :=',
'        (CASE WHEN totalCholesterol >= 240 THEN 1 ELSE 0 END) +',
'        ((CASE WHEN systolicBloodPressure >= 160 THEN 1 ELSE 0 END) +',
'          (CASE WHEN hypertensive = 1 THEN 1 ELSE 0 END)) +',
'        (CASE WHEN smoker = 1 THEN 1 ELSE 0 END) +',
'        (CASE WHEN diabetic = 1 THEN 1 ELSE 0 END);',
'      elevated_score :=',
'        ((CASE WHEN totalCholesterol >= 200 AND totalCholesterol < 240 THEN 1 ELSE 0 END) +',
'          CASE WHEN (CASE WHEN systolicBloodPressure >= 140 AND systolicBloodPressure < 160 AND hypertensive = 0 THEN 1 ELSE 0 END) >= 1 THEN 1 ELSE 0 END) *',
'        (CASE WHEN major = 0 THEN 1 ELSE 0 END);',
'      all_optimal :=',
'        ((CASE WHEN totalCholesterol < 180 THEN 1 ELSE 0 END) +',
'          (CASE WHEN systolicBloodPressure < 120 THEN 1 ELSE 0 END) *',
'            CASE WHEN (CASE WHEN hypertensive = 0 THEN 1 ELSE 0 END) = 2 THEN 1 ELSE 0 END) *',
'        (CASE WHEN major = 0 THEN 1 ELSE 0 END);',
'      not_optimal :=',
'        ((CASE WHEN totalCholesterol >= 180 AND totalCholesterol < 200 THEN 1 ELSE 0 END) +',
'          (CASE WHEN systolicBloodPressure >= 120 AND systolicBloodPressure < 140 AND hypertensive = 0 THEN 1 ELSE 0 END)) *',
'          (CASE WHEN elevated_score = 0 THEN 1 ELSE 0 END) *',
'          CASE WHEN (CASE WHEN major = 0 THEN 1 ELSE 0 END) >= 1 THEN 1 ELSE 0 END;',
'',
'      IF major > 1 THEN',
'        ascvdRisk := major2;',
'      ELSIF major = 1 THEN',
'        ascvdRisk := major1;',
'      ELSIF elevated_score = 1 THEN',
'        ascvdRisk := elevated;',
'      ELSIF not_optimal = 1 THEN',
'        ascvdRisk := notOptimal;',
'      ELSIF all_optimal = 1 THEN',
'        ascvdRisk := allOptimal;',
'      END IF;',
'',
'    --   raise_application_error(-20001, ''ascvdRisk: '' || ascvdRisk || '' major: '' || major || '' allOptimal: '' || allOptimal || '' elevated: '' || elevated || '' notOptimal: '' || notOptimal);',
'',
'    END;',
'',
'    RETURN ascvdRisk;',
'  END;',
'  ---',
'  FUNCTION computeLowestTenYear(age IN NUMBER,',
'                               race IN VARCHAR2,',
'                               gender IN VARCHAR2) ',
'  RETURN NUMBER IS',
'    systolicBloodPressure NUMBER := 90;',
'    totalCholesterol NUMBER := 130;',
'    hdl NUMBER := 100;',
'    diabetic NUMBER := 0;',
'    smoker NUMBER := 0;',
'    hypertensive NUMBER := 0;',
'  BEGIN',
'    RETURN ASCVD_RISK_CALCULATOR.computeTenYearScore(age, totalCholesterol, hdl, systolicBloodPressure, hypertensive, smoker, diabetic, race, gender);',
'  END;',
'  ---',
'  FUNCTION computeLowestLifetime(age IN NUMBER,',
'                               race IN VARCHAR2,',
'                               gender IN VARCHAR2) ',
'  RETURN NUMBER IS',
'    systolicBloodPressure NUMBER := 90;',
'    totalCholesterol NUMBER := 130;',
'    hdl NUMBER := 100;',
'    diabetic NUMBER := 0;',
'    smoker NUMBER := 0;',
'    hypertensive NUMBER := 0;',
'  BEGIN',
'    RETURN ASCVD_RISK_CALCULATOR.computeLifetimeRisk(age, totalCholesterol, hdl, systolicBloodPressure, hypertensive, smoker, diabetic, race, gender);',
'  END;',
'  ---',
'  FUNCTION computePotentialRisk(reductions IN VARCHAR2, ',
'                                score IN VARCHAR2,',
'                                age IN NUMBER, ',
'                                totalCholesterol IN NUMBER, ',
'                                hdl IN NUMBER, ',
'                                systolicBloodPressure IN NUMBER, ',
'                                hypertensive IN NUMBER,',
'                                smoker IN NUMBER,',
'                                diabetic IN NUMBER,',
'                                race IN VARCHAR2,',
'                                gender IN VARCHAR2)',
'  RETURN NUMBER IS',
'    computedScore NUMBER;',
'    lowestScore NUMBER;',
'    reducedTotalScore NUMBER := 0;',
'    sysBPCalculation NUMBER;',
'    reduction VARCHAR2(255);',
'    start_pos NUMBER := 1;',
'    comma_pos NUMBER;',
'  BEGIN',
'    IF score = ''ten'' THEN',
'      computedScore := ASCVD_RISK_CALCULATOR.computeTenYearScore(age, totalCholesterol, hdl, systolicBloodPressure, hypertensive, smoker, diabetic, race, gender);',
'      lowestScore := ASCVD_RISK_CALCULATOR.computeLowestTenYear(age, race, gender);',
'    ELSE',
'      computedScore := ASCVD_RISK_CALCULATOR.computeLifetimeRisk(age, totalCholesterol, hdl, systolicBloodPressure, hypertensive, smoker, diabetic, race, gender);',
'      lowestScore := ASCVD_RISK_CALCULATOR.computeLowestLifetime(age, race, gender);',
'    END IF;',
'    ',
'    comma_pos := INSTR(reductions, '','', start_pos);',
'    ',
'    WHILE comma_pos > 0 LOOP',
'      reduction := SUBSTR(reductions, start_pos, comma_pos - start_pos);',
'      ',
'      IF reduction = ''statin'' THEN',
'        reducedTotalScore := reducedTotalScore + computedScore * 0.25;',
'      ELSIF reduction = ''sysBP'' THEN',
'        sysBPCalculation := computedScore - computedScore * POWER(0.7, ((systolicBloodPressure - 140) / 10));',
'        reducedTotalScore := reducedTotalScore + sysBPCalculation;',
'      ELSIF reduction = ''aspirin'' THEN',
'        reducedTotalScore := reducedTotalScore + computedScore * 0.1;',
'      ELSIF reduction = ''smoker'' THEN',
'        reducedTotalScore := reducedTotalScore + computedScore * 0.15;',
'      END IF;',
'      ',
'      start_pos := comma_pos + 1;',
'      comma_pos := INSTR(reductions, '','', start_pos);',
'    END LOOP;',
'',
'    -- process last item in the list',
'    reduction := SUBSTR(reductions, start_pos);',
'    IF reduction = ''statin'' THEN',
'      reducedTotalScore := reducedTotalScore + computedScore * 0.25;',
'    ELSIF reduction = ''sysBP'' THEN',
'      sysBPCalculation := computedScore - computedScore * POWER(0.7, ((systolicBloodPressure - 140) / 10));',
'      reducedTotalScore := reducedTotalScore + sysBPCalculation;',
'    ELSIF reduction = ''aspirin'' THEN',
'      reducedTotalScore := reducedTotalScore + computedScore * 0.1;',
'    ELSIF reduction = ''smoker'' THEN',
'      reducedTotalScore := reducedTotalScore + computedScore * 0.15;',
'    END IF;',
'',
'    IF ROUND((computedScore - reducedTotalScore), 1) <= lowestScore THEN',
'      RETURN ROUND((computedScore - lowestScore), 1);',
'    END IF;',
'    ',
'    RETURN abs(ROUND(reducedTotalScore, 1));',
'  END;',
'  ---',
'  FUNCTION lowestPossibleRisk(age IN NUMBER,',
'                               race IN VARCHAR2,',
'                               gender IN VARCHAR2) ',
'  RETURN NUMBER IS',
'  begin',
'    RETURN ASCVD_RISK_CALCULATOR.computeLowestLifetime(age, race, gender) + ASCVD_RISK_CALCULATOR.computeLowestTenYear(age, race, gender);',
'  end;',
'',
'',
'end ASCVD_RISK_CALCULATOR;',
'/ '))
);
